import * as React from 'react';
import { View, Dimensions } from 'react-native';

const paddingBot = {
  paddingBottom: '2%'
}

const paddingTop = {
  paddingTop: '2%'
}

const style = {
  backgroundColor: 'gray',
  height: 0.5,
  width: props.width,
  marginTop: 10,
}

function Divider(props)
{
  var padding = (props.useBottomPadding ? paddingBot : paddingTop)

  return(
    <View
      style={[ style, padding ]}
    />
  )
}

export { Divider };
